    <script>
		$(function(){
			refreshVerifyImage();
			$("#userName").focus();
			$("#verifyImage").click(function(){
				refreshVerifyImage();
			});
			$(document).keydown(function(event){
				switch(event.keyCode) {
					case 13:{
						$("#submit").click();
						break;
					}
				}
			});
			$("#submit").click(function(){
				var userName = $("#userName").val();
				var password = $("#password").val();
				var verifyCode = $("#verifyCode").val();
				if(!userName || userName==null || userName==""){
					alert("..............!");
					return false;
				}
				if(!password || password==null || password==""){
					alert("............!");
					return false;
				}
				if(!verifyCode || verifyCode==null || verifyCode==""){
					alert("..............!");
					return false;
				}
				var data = {};			
				data.userName = userName;
				data.password = hex_md5(password);
				data.verifyCode = verifyCode;

				$("#submit").attr("disabled", true);
				$.post(
					"/loginAction.do?cmd=login", 
					data,
					function(result){
						if(result.code != 0){
							refreshVerifyImage();
							$("#verifyCode").val("");
							alert(result.message);
							$("#submit").attr("disabled", false);
						}else{
							window.location.href="/jsp/mainFrame.jsp";
						}
					}, 
					"json"
				);
			});
			$("#reset").click(function(){
				$("#userName").val("").focus();
				$("#password").val("");
				$("#verifyCode").val("");
			});
		});
		function refreshVerifyImage(){
 			$("#verifyImage").attr("src","/loginAction.do?cmd=verifyImage&random="+Math.floor(Math.random()*(10000+1)));
		}
	</script>
